import React, { useState, useContext } from "react";
import Compose from "./Compose";
import { NavLink } from "react-router-dom";
import { Context } from "./Mycontext";

export const Taille = props => {
  return (
    <div>
      <img
        src="./img/nav/3.png"
        alt="ok"
        className="w-20 h-20 flex justify-content-center z-1  items-center mx-auto"
      />
      <div className="flex mx-auto justify-center items-center">
        <h2 className="uppercase text-3xl italic font-bold tracking-widest">
          Taille
        </h2>
      </div>
      <div className="">
        {props.tacos.map(oneTacos => {
          return <h1>{oneTacos.id}</h1>;
        })}
      </div>
      ;
    </div>
  );
};

export const Viandes = props => {
  const { nextTacos } = useContext(Context);
  return (
    <div className=" relative myFund container text-center flex-col rounded-xl  bg-white h-3/5 w-2/4 ">
      <Compose />

      <NavLink to="/sauces">
        <span className=" p-9 text-7xl" onClick={() => nextTacos(3)}>
          &#10093;
        </span>
      </NavLink>
    </div>
  );
};

export const Sauces = () => {
  const { nextTacos } = useContext(Context);
  return (
    <div className=" relative myFund container text-center flex-col rounded-xl  bg-white h-3/5 w-2/4 ">
      <Compose />
      <NavLink to="/sauces">
        <span className=" p-9 text-7xl" onClick={() => nextTacos(3)}>
          &#10093;
        </span>
      </NavLink>
    </div>
  );
};

export const Extra = () => {
  return (
    <li>
      <img
        src="./img/nav/1.png"
        alt="ok"
        className="w-20 h-20 flex justify-content-center items-center mx-auto"
      />
      <div className="flex mx-auto items-center">
        <span className="h-10 w-10 bg-green-800 px-4 py-2 mx-2 text-white">
          4
        </span>
        <h2>EXTRA</h2>
      </div>
    </li>
  );
};
